import React from "react"

const PatientSearch = () => {
    
    return (
        <div>
            <div className='search'>
                <input type="text" placeholder="Search Patient ID"/>
                <button className='searchButton'>Search</button>
            </div>
        </div>
    )
}

export default PatientSearch
